import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as r,a as d}from"./app.b8e2f206.js";const h={},i=d('<p>\u6B66\u5668\u662F\u9B54\u6CD5\u5C11\u5973\u8868\u73B0\u80FD\u529B\u7684\u4E3B\u8981\u65B9\u5F0F\u4E4B\u4E00\u3002\u6BCF\u4E2A\u9B54\u6CD5\u5C11\u5973\u53EF\u4EE5\u62E5\u6709\u4E00\u4E2A\u5C5E\u4E8E\u81EA\u5DF1\u7684\u6B66\u5668\u3002\u8FD9\u4E9B\u6B66\u5668\u80FD\u591F\u7ED3\u5408\u9B54\u6CD5\u5C11\u5973\u62E5\u6709\u7684\u5176\u4ED6\u80FD\u529B\u7EC4\u5408\u51FA\u66F4\u52A0\u5F3A\u5927\u7684\u653B\u51FB\u65B9\u5F0F\u3002</p><h2 id="\u51B3\u5B9A\u6B66\u5668" tabindex="-1"><a class="header-anchor" href="#\u51B3\u5B9A\u6B66\u5668" aria-hidden="true">#</a> \u51B3\u5B9A\u6B66\u5668</h2><p>\u9996\u5148\u8981\u9009\u62E9\u4F60\u7684\u6B66\u5668\u7C7B\u578B\uFF0C\u4F60\u662F\u60F3\u62E5\u6709\u50CF\u7075\u6D3B\u7684\u5355\u624B\u5251\u4E00\u6837\u53EF\u4EE5\u6E38\u8D70\u5728\u654C\u4EBA\u8EAB\u8FB9\u6218\u6597\u7684\u6B66\u5668\uFF0C\u8FD8\u662F\u60F3\u62E5\u6709\u50CF\u6F47\u6D12\u7684\u71E7\u53D1\u67AA\u4E00\u6837\u5728\u8FDC\u8DDD\u79BB\u81EA\u7531\u6218\u6597\u7684\u6B66\u5668\uFF1F</p><p>\u663E\u800C\u6613\u89C1\u7684\uFF0C\u5355\u624B\u5251\u662F\u8FD1\u6218\u6B66\u5668\uFF0C\u800C\u71E7\u53D1\u67AA\u662F\u8FDC\u7A0B\u6B66\u5668\uFF0C\u800C\u4F60\u60F3\u8981\u7684\u6B66\u5668\u5E94\u8BE5\u662F\u8FD1\u6218\u8FD8\u662F\u8FDC\u7A0B\u5462\uFF1F</p><p>\uFF08\u5173\u4E8E\u6B66\u5668\u7C7B\u578B\u7684\u5177\u4F53\u89E3\u91CA\u4F1A\u5728\u4E0B\u9762\u5217\u51FA\u8BE6\u7EC6\u7684\u8BF4\u660E\uFF09</p><p>\u5728\u51B3\u5B9A\u4E86\u6B66\u5668\u7C7B\u578B\u4E4B\u540E\uFF0C\u8981\u786E\u5B9A\u6B66\u5668\u7684\u57FA\u7840\u5C5E\u6027\uFF0C</p><p><strong>\u8FD1\u6218</strong> \u6B66\u5668\u7684\u5C5E\u6027\u662F\uFF1A <strong>\u653B\u51FB\uFF0C\u91CD\u91CF\uFF0C\u575A\u97E7\u6027</strong></p><p><strong>\u8FDC\u7A0B</strong> \u6B66\u5668\u7684\u5C5E\u6027\u662F\uFF1A <strong>\u653B\u51FB\uFF0C\u91CD\u91CF\uFF0C\u653B\u51FB\u8DDD\u79BB</strong></p><p>\uFF08\u8FD9\u4E9B\u5C5E\u6027\u5C06\u4F1A\u7531\u63B7\u9AB0\u7684\u65B9\u5F0F\u51B3\u5B9A\uFF0C\u5177\u4F53\u5C5E\u6027\u5185\u5BB9\u53CA\u63B7\u9AB0\u65B9\u6CD5\u4F1A\u5728\u4E0B\u9762\u5217\u51FA\u8BE6\u7EC6\u7684\u8BF4\u660E\u3002\uFF09</p><h2 id="\u6B66\u5668\u5C5E\u6027" tabindex="-1"><a class="header-anchor" href="#\u6B66\u5668\u5C5E\u6027" aria-hidden="true">#</a> \u6B66\u5668\u5C5E\u6027</h2><h3 id="\u653B\u51FB-dam-\u9AB02d6-6-\u5373\u662F\u653B\u51FB\u5C5E\u6027" tabindex="-1"><a class="header-anchor" href="#\u653B\u51FB-dam-\u9AB02d6-6-\u5373\u662F\u653B\u51FB\u5C5E\u6027" aria-hidden="true">#</a> \u653B\u51FB\uFF08DAM\uFF09\uFF1A\u9AB02D6+6\uFF0C\u5373\u662F\u653B\u51FB\u5C5E\u6027</h3><p>\u653B\u51FB\u6307\u6B66\u5668\u6240\u62E5\u6709\u7684\u57FA\u7840\u653B\u51FB\u529B\uFF0C\u653B\u51FB\u503C\u4E3A\u6B66\u5668\u7684\u57FA\u7840\u6700\u5927\u4F24\u5BB3\uFF08DAM\uFF09\u3002\u6B66\u5668\u7684\u57FA\u7840\u4F24\u5BB3\u4E3A1dDAM\u3002</p><h3 id="\u91CD\u91CF-wei-\u9AB01d20-\u7ED3\u679C\u4E585-\u5373\u662F\u91CD\u91CF\u5C5E\u6027" tabindex="-1"><a class="header-anchor" href="#\u91CD\u91CF-wei-\u9AB01d20-\u7ED3\u679C\u4E585-\u5373\u662F\u91CD\u91CF\u5C5E\u6027" aria-hidden="true">#</a> \u91CD\u91CF\uFF08WEI\uFF09\uFF1A\u9AB01D20\uFF0C\u7ED3\u679C\u4E585\uFF0C\u5373\u662F\u91CD\u91CF\u5C5E\u6027</h3><p>\u91CD\u91CF\u6307\u7269\u4F53\u7684\u91CD\u91CF\uFF0C\u4E00\u5B9A\u7A0B\u5EA6\u4E0A\u4E5F\u4EE3\u8868\u4E86\u6B66\u5668\u7684\u4F53\u79EF\u3002\u9AD8\u91CD\u91CF\u7684\u6B66\u5668\u80FD\u591F\u83B7\u5F97\u653B\u51FB\u52A0\u6210\uFF0C\u4F46\u540C\u65F6\u9B54\u6CD5\u5C11\u5973\u5E26\u7740\u5B83\u8FDB\u884C\u653B\u51FB\u548C\u79FB\u52A8\u4E5F\u9700\u8981\u6D88\u8017\u66F4\u591ADP\u3002\u6B66\u5668\u7684\u91CD\u91CF\u9AD8\u4E8E50\u65F6\uFF0C\u6295\u63B7\u8DDD\u79BB\u51CF\u534A\uFF0C\u91CD\u91CF\u9AD8\u4E8E80\u7684\u6B66\u5668\u88AB\u8BA4\u4E3A\u65E0\u6CD5\u6295\u63B7\u3002</p><ul><li>1\uFF0D25\u8F7B\u6B66\u5668\uFF1A\u6BCF\u6B21\u653B\u51FB\u7684\u6D88\u8017\u548C\u4F24\u5BB3\u5747\u4E3A\u539F\u653B\u51FB\u7684\u4E00\u534A\u3002</li><li>26\uFF0D50\u6807\u51C6\u6B66\u5668\uFF1A\u6B63\u5E38\u8BA1\u7B97</li><li>51\uFF0D75\u91CD\u6B66\u5668\uFF1A\u5355\u6B21\u653B\u51FB\u7684\u6D88\u8017\u548C\u4F24\u5BB3\u5747\u4E3A\u539F\u653B\u51FB\u76841.5\u500D\u3002\u540C\u65F6\u83B7\u5F97\u4E00\u4E2A1d3\u7684\u4F24\u5BB3\u52A0\u503C</li><li>76\uFF0D100\u8D85\u91CD\u6B66\u5668\uFF1A\u5355\u6B21\u653B\u51FB\u7684\u6D88\u8017\u548C\u4F24\u5BB3\u5747\u4E3A\u539F\u653B\u51FB\u76842\u500D\u3002\u540C\u65F6\u83B7\u5F97\u4E00\u4E2A1d6\u7684\u4F24\u5BB3\u52A0\u503C \u91CD\u91CF\u5C5E\u6027\u5BFC\u81F4\u7684\u79FB\u52A8\u901F\u5EA6\u53D8\u5316\u5728DP\u76F8\u5173\u90E8\u5206\u8BE6\u7EC6\u4ECB\u7ECD</li></ul><h3 id="\u653B\u51FB\u8DDD\u79BB-len-\u9AB03d6-\u5373\u662F\u653B\u51FB\u8DDD\u79BB" tabindex="-1"><a class="header-anchor" href="#\u653B\u51FB\u8DDD\u79BB-len-\u9AB03d6-\u5373\u662F\u653B\u51FB\u8DDD\u79BB" aria-hidden="true">#</a> \u653B\u51FB\u8DDD\u79BB\uFF08LEN\uFF09\uFF1A\u9AB03D6\uFF0C\u5373\u662F\u653B\u51FB\u8DDD\u79BB</h3><p>\u653B\u51FB\u8DDD\u79BB\u6307\u8FDC\u7A0B\u6B66\u5668\u7684\u653B\u51FB\u8DDD\u79BB\u4E0A\u9650\uFF0C\u6B66\u5668\u7684\u653B\u51FB\u8DDD\u79BB\u7EA6\u4E3A\u653B\u51FB\u8DDD\u79BB\u5C5E\u6027\u4E5810\u7C73</p><h3 id="\u575A\u97E7\u6027-def-\u9AB03d6-\u5373\u662F\u575A\u97E7\u5C5E\u6027" tabindex="-1"><a class="header-anchor" href="#\u575A\u97E7\u6027-def-\u9AB03d6-\u5373\u662F\u575A\u97E7\u5C5E\u6027" aria-hidden="true">#</a> \u575A\u97E7\u6027\uFF08DEF\uFF09\uFF1A\u9AB03D6\uFF0C\u5373\u662F\u575A\u97E7\u5C5E\u6027</h3><p>\u575A\u97E7\u6027\u6307\u6B66\u5668\u6240\u80FD\u591F\u62B5\u6321\u7684\u4F24\u5BB3\uFF0C\u5F53\u9B54\u6CD5\u5C11\u5973\u5728\u683C\u6321\u65F6\uFF0C\u80FD\u591F\u4F7F\u7528\u6B66\u5668\u62B5\u6321\u90E8\u5206\u4F24\u5BB3\u3002\u575A\u97E7\u6027\u4E3A\u6B66\u5668\u7684\u57FA\u7840\u6700\u5927\u683C\u6321\uFF08DEF\uFF09\u3002\u6B66\u5668\u7684\u57FA\u7840\u683C\u6321\u4E3A1dDEF\u3002</p><h2 id="\u6B66\u5668\u7C7B\u578B" tabindex="-1"><a class="header-anchor" href="#\u6B66\u5668\u7C7B\u578B" aria-hidden="true">#</a> \u6B66\u5668\u7C7B\u578B</h2><p>\u8FD1\u6218\u6B66\u5668\u548C\u8FDC\u7A0B\u6B66\u5668\u7684\u533A\u522B\u5728\u54EA\uFF1F</p><p>\u6B66\u5668\u5728\u653B\u51FB\u8DDD\u79BB\u4E0A\u7684\u5DEE\u522B\u5206\u4E3A\u8FD1\u6218\u6B66\u5668\u6216\u8005\u8FDC\u7A0B\u6B66\u5668\uFF0C\u8FD1\u6218\u6B66\u5668\u5F53\u7136\u53EA\u80FD\u5BF9\u8EAB\u8FB9\u7684\u654C\u4EBA\u8FDB\u884C\u653B\u51FB\uFF0C\u800C\u8FDC\u7A0B\u6B66\u5668\u5C31\u53EF\u4EE5\u5728\u66F4\u5B89\u5168\u7684\u4F4D\u7F6E\u8FDB\u884C\u653B\u51FB\u3002</p><p>\u8FD1\u6218\u6B66\u5668\u4E5F\u53EF\u4EE5\u901A\u8FC7\u6295\u63B7\u7B49\u6280\u80FD\u7528\u4F5C\u8FDC\u8DDD\u79BB\u4F7F\u7528\u3002</p><p>\u8FDC\u7A0B\u6B66\u5668\u6CA1\u6709\u575A\u97E7\u6027\uFF0C\u8FD9\u610F\u5473\u7740\u901A\u5E38\u8FDC\u7A0B\u6B66\u5668\u5E76\u4E0D\u80FD\u8FDB\u884C\u683C\u6321\u3002</p><p>\u8FDC\u7A0B\u6B66\u5668\u901A\u5E38\u4E0D\u4EAB\u53D7\u8FD1\u6218\u7684\u4F24\u5BB3\u52A0\u503C\u2014\u2014\u9664\u975E\u4F60\u628A\u4F60\u7684\u71E7\u53D1\u67AA\u5F53\u68D2\u7403\u68CD\u800D\uFF0C\u4E0D\u8FC7\u8FD9\u6837\u4F60\u7684\u6B66\u5668\u4F24\u5BB3\u4F1A\u51CF\u5C11\u4E00\u534A\u751A\u81F3\u66F4\u591A\uFF0C\u5177\u4F53\u60C5\u51B5\u89C6\u4E3B\u6301\u4EBA\u51B3\u5B9A\u3002</p><p>\u6CE8\u610F\uFF1A\u6211\u4EEC\u5F53\u7136\u6709\u8003\u8651\u8FC7\u5C06\u5355\u624B\u5251\u6295\u63B7\u8FDB\u884C\u8FDC\u7A0B\u653B\u51FB\u6216\u8005\u628A\u71E7\u53D1\u67AA\u5F53\u6210\u68D2\u7403\u68CD\u8FDB\u884C\u8FD1\u6218\u653B\u51FB\u7684\u5F62\u5F0F\uFF0C\u4F46\u662F\u8981\u660E\u786E\u7684\u662F\uFF0C\u5B83\u4EEC\u7684\u57FA\u7840\u662F\u4EC0\u4E48\u6B66\u5668\uFF1F\u5315\u9996\u5F53\u7136\u662F\u8FD1\u6218\u6B66\u5668\uFF0C\u71E7\u53D1\u67AA\u5F53\u7136\u662F\u8FDC\u7A0B\u6B66\u5668\uFF0C\u5E76\u4E0D\u4F1A\u56E0\u4E3A\u5B83\u6709\u72EC\u7279\u7684\u7528\u6CD5\u5C31\u4F1A\u88AB\u5F53\u4F5C\u53E6\u4E00\u79CD\u7C7B\u578B\u3002</p><h2 id="\u9644\u52A0\u5C5E\u6027" tabindex="-1"><a class="header-anchor" href="#\u9644\u52A0\u5C5E\u6027" aria-hidden="true">#</a> \u9644\u52A0\u5C5E\u6027</h2><p>\u6BCF\u4E2A\u6B66\u5668\u62E5\u6709\u4E0D\u540C\u7684\u9644\u52A0\u5C5E\u6027\uFF0C\u8FD9\u4E9B\u9644\u52A0\u5C5E\u6027\u80FD\u591F\u5BF9\u6B66\u5668\u7684\u5C5E\u6027\u503C\u8FDB\u884C\u8C03\u6574\u6216\u662F\u63D0\u4F9B\u66F4\u52A0\u591A\u6837\u7684\u6B66\u5668\u5F62\u6001\u548C\u653B\u51FB\u65B9\u5F0F\u3002\u6B66\u5668\u7684\u9644\u52A0\u5C5E\u6027\u4E5F\u53EF\u4EE5\u4F7F\u6B66\u5668\u53D8\u5316\u4E3A\u5B8C\u5168\u4E0D\u540C\u7684\u5F62\u6001\uFF0C\u9644\u52A0\u5C5E\u6027\u4E2D\u7279\u6B8A\u7684\u653B\u51FB\u65B9\u5F0F\u6240\u80FD\u9020\u6210\u7684\u6548\u679C\u4E00\u822C\u4F1A\u548C\u6B66\u5668\u7684\u5C5E\u6027\u503C\u76F8\u5173\u3002</p><p>\u73A9\u5BB6\u5728\u786E\u5B9A\u4E86\u6B66\u5668\u7C7B\u578B\u540E\uFF0C\u5C06\u51B3\u5B9A\u6B66\u5668\u7684\u9644\u52A0\u5C5E\u6027\uFF0C\u6BCF\u4E2A\u6B66\u5668\u62E5\u67092\u4E2A\u9644\u52A0\u5C5E\u6027\uFF0C\u4E00\u4E2A\u662F\u88AB\u52A8\u5C5E\u6027\uFF0C\u5F53\u6EE1\u8DB3\u6761\u4EF6\u65F6\u4FBF\u4F1A\u81EA\u52A8\u89E6\u53D1\uFF0C\u53E6\u4E00\u4E2A\u662F\u4E3B\u52A8\u5C5E\u6027\uFF0C\u9700\u8981\u73A9\u5BB6\u4E3B\u52A8\u6D88\u8017MP\u624D\u80FD\u89E6\u53D1\uFF0C\u5728\u83B7\u5F97\u4E3B\u6301\u4EBA\u540C\u610F\u540E\uFF0C\u4E5F\u53EF\u4EE5\u4E3A\u6B66\u5668\u8BBE\u8BA1\u591A\u4E2A\u9644\u52A0\u5C5E\u6027</p><p>\u8BE6\u89C1\u9B54\u6CD5\u5D29\u574F\u6570\u636E\u5E93</p><h2 id="\u4F24\u5BB3\u7C7B\u578B" tabindex="-1"><a class="header-anchor" href="#\u4F24\u5BB3\u7C7B\u578B" aria-hidden="true">#</a> \u4F24\u5BB3\u7C7B\u578B</h2><p>\u4F60\u7684\u6B66\u5668\u4F1A\u9020\u6210\u600E\u6837\u7684\u6740\u4F24\u6548\u679C\uFF1F\u662F\u5355\u624B\u5251\u5288\u780D\u5F00\u654C\u4EBA\uFF0C\u4EA6\u6216\u662F\u71E7\u53D1\u67AA\u5C04\u7A7F\u654C\u4EBA\uFF0C\u53C8\u6216\u662F\u4E00\u628A\u9524\u5B50\u7838\u6655\u654C\u4EBA\uFF1F\u4E0D\u7BA1\u662F\u600E\u6837\u7684\u6B66\u5668\uFF0C\u5927\u4F53\u4E0A\u53EF\u4EE5\u5206\u6210\u4E09\u79CD\u4F24\u5BB3\u7C7B\u578B\uFF1A</p><ul><li>\u5203\u5F62\uFF1A\u53EF\u4EE5\u5C06\u5BF9\u65B9\u5207\u5F00\uFF0C\u8FD9\u53EF\u80FD\u4F1A\u5F62\u6210\u4F24\u53E3</li><li>\u77E2\u5F62\uFF1A\u53EF\u4EE5\u5C06\u63A9\u4F53\u548C\u7269\u4F53\u8D2F\u7A7F\uFF0C\u5BF9\u88AB\u906E\u853D\u7684\u5BF9\u8C61\u9020\u6210\u4F24\u5BB3</li><li>\u7403\u5F62\uFF08\u949D\u5F62\uFF09\uFF1A\u53EF\u4EE5\u5C06\u5BF9\u65B9\u51FB\u9000\uFF0C\u8FD9\u4F1A\u6253\u65AD\u5BF9\u65B9\u7684\u52A8\u4F5C\u3002</li></ul><h2 id="\u795E\u7B51\u8D4B\u5F62" tabindex="-1"><a class="header-anchor" href="#\u795E\u7B51\u8D4B\u5F62" aria-hidden="true">#</a> \u795E\u7B51\u8D4B\u5F62</h2><p>\u5728\u6700\u540E\uFF0C\u73A9\u5BB6\u53EF\u4EE5\u6839\u636E\u5404\u9879\u5C5E\u6027\uFF0C\u51B3\u5B9A\u6B66\u5668\u7684\u540D\u5B57\uFF0C\u6700\u597D\u540D\u5B57\u4E2D\u5E26\u6709\u201C\u5F13\u201D\u201C\u67AA\u201D\u7B49\u660E\u786E\u7684\uFF0C\u4EE3\u8868\u7740\u6B66\u5668\u4F7F\u7528\u65B9\u5F0F\u7684\u5B57\u8BCD\u3002\u5426\u5219\u73A9\u5BB6\u9700\u8981\u63CF\u8FF0\u8FD9\u4E2A\u6B66\u5668\u7684\u5F62\u72B6\uFF0C\u4EE5\u53CA\u8FD9\u4E2A\u6B66\u5668\u8BE5\u5982\u4F55\u4F7F\u7528\u3002\u867D\u7136\u8FD9\u4E9B\u63CF\u8FF0\u4E0D\u4F1A\u6539\u53D8\u6B66\u5668\u7684\u5C5E\u6027\uFF0C\u4F46\u662F\u5728\u6E38\u620F\u8FC7\u7A0B\u4E2D\uFF0C\u4E0D\u540C\u7684\u6B66\u5668\u4F7F\u7528\u65B9\u5F0F\u53EF\u80FD\u4F1A\u5E26\u6765\u4E00\u5B9A\u7684\u9650\u5236\u6216\u662F\u4F18\u52BF\u3002\u5145\u5206\u800C\u51C6\u786E\u7684\u63CF\u8FF0\u53EF\u4EE5\u5E2E\u52A9\u4E3B\u6301\u4EBA\u505A\u51FA\u66F4\u7B26\u5408\u73A9\u5BB6\u5370\u8C61\u7684\u5224\u65AD\u3002</p>',35),n=[i];function p(t,s){return e(),r("div",null,n)}var o=a(h,[["render",p],["__file","arms.html.vue"]]);export{o as default};
